Job Description:
Over deze vacature Als Junior Data Engineer krijg jij de kans om de transitie naar een data gedreven organisatie mede vorm te geven. In een agile multidisciplinaire omgeving werk je samen met je collega’s met de nieuwste technieken en methodes. Heb jij passie voor werken met data, wil jij het Data Engineering vakgebied (verder) verkennen en vind je het een grote uitdaging om in een scrumteam een datawarehouse op het Microsoft Azure platform te implementeren? Dan maken wij graag kennis met jou!

Als Data Engineer ben je verantwoordelijk voor het ontwikkelen en onderhouden van dataproducten. Je maakt van een databron een reproduceerbaar en schaalbaar dataproduct dat gebruikt kan worden in de analytische oplossing. Je werkt nauw samen met Data Scientists, overige dataspecialisten en domeinexperts om datagedreven oplossingen te realiseren en om data (science) producten en diensten te operationaliseren.

Wat ga je doen?

Je ontsluit, importeert, koppelt en uploadt data op het gebied van sparen, hypotheken en risico-modellen;
Je zoekt voortdurend naar mogelijkheden om de analysesets verder te verrijken om zo ons datapotentieel beter te benutten;
Je ontwikkelt en optimaliseert de data- en modelpijplijnen. Je zorgt met jouw modelbeheer dat het model zorgeloos kan draaien in productie en je zorgt dat het reproduceerbaar is;
Je begrijpt de mogelijkheden binnen een bestaand datalandschap en kan hier keuzes over maken. Je onderzoekt de huidige kaders en experimenteert om jouw werk en dat van je directe collega’s efficiënter te maken. Wat jou uniek maakt als Junior Data Engineer Achmea Bank
Je hebt minimaal hbo werk- en denkniveau;
Je hebt aantoonbare affiniteit met programmeren;
Je wil graag jezelf én ons verder helpen ontwikkelen in de wereld van Microsoft Azure;
Je werkt graag met data en kan jouw interne stakeholders hier ook in meenemen;
Jij bent eerlijk en daadkrachtig en kunt goed communiceren. Je zegt waar het op staat, maar blijft wel constructief en positief;
Met jouw enthousiasme neem je een prominente rol op je in het team. Je toont initiatief, bent leergierig en voortdurend bezig met je eigen ontwikkeling en de ontwikkelingen in de markt. Wat wij bieden Als Hartloper bij Achmea zet jij je elke dag in voor een gezonde, veilige én duurzame toekomst. En daar belonen we je graag voor! Natuurlijk krijg je bij ons een goed salaris, een mooie pensioenregeling mét lage eigen bijdrage (3,25%), 136 verlofuren (op basis van 34 uur per week) én korting op onze verzekeringen (ka-ching!). Maar er is meer:

Een 34-urige werkweek is bij Achmea de standaard! Je werkt dan bijvoorbeeld 4 dagen van 8,5 uur. Zo heb je nóg meer tijd voor vrijwilligerswerk, een goed boek, mantelzorg óf jouw favoriete sport!
Onder de noemer AllYouCanLearn volg je onbeperkt opleidingen, cursussen en trainingen. Achmea betaalt en toestemming van je leidinggevende is niet nodig.
Vanaf 2023 krijg je €2500 Klimaatbudget (bij een fulltime dienstverband) bijvoorbeeld om je huis te verduurzamen, duurzaam witgoed te kopen óf een elektrische fiets aan te schaffen. Dit bedrag is bedoeld voor producten en diensten die een bijdrage leveren aan verduurzaming en dus de verbetering van het milieu. Je schaft deze producten en diensten aan via onze klimaatwinkel.
Gezond werken vinden we belangrijk, dus zorgen we ook dat dit kan met een berg healthy initiatieven!
Je ontvangt maandelijks een persoonlijk keuzebudget, opgebouwd uit 8% vakantietoeslag, 8,33% eindejaarsuitkering en 3,85% bovenwettelijk verlof. Je kiest zelf op welk moment je dit budget laat uitbetalen, je het gebruikt voor verlofsparen of dat je er vakantie-uren van koopt.

