Over deze vacature Met ons team Data Science werken we voor Schade Particulieren: onze data-oplossingen dragen bij aan de ambities die we als datagedreven verzekeraar hebben. Zo werken we aan modellen die onze collega’s helpen in de werkverdeling van claims, bepalen we de contactreden door spraak naar tekst om te zetten middels NLP én sporen we fraude op. Zo zetten we met onze data-oplossing elke euro in op de juiste manier. Daarnaast werken we elke dag aan nieuwe modellen!

Wat ga jij doen?

Jij zorgt dat onze modellen goed werken binnen de systemen van Achmea, door business services te programmeren in Python;
Je configureert applicaties zodat ze altijd beschikbaar zijn (in OpenShift);
Je ontsluit data van bronsystemen naar Datalake met behulp van Datafactory zodat data altijd beschikbaar is voor analyses;
